import React from 'react'

 function WeatherDetails() {
  return (
    <>
    <article className='widget'>
        <div className='weatherIcon'>
      <i class="wi wi-day-sunny"></i>
      </div>
    </article>  
    </>
  )
}

export default WeatherDetails;
